import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({getQuestionId}){


    const q = getQuestionId(2);

    return(
        <Paper>
            <h1>Detail's page</h1>  
            <p>{q.title}</p>
        </Paper>
    )
}
export default Question;
